var Product = require('../models/product');

var mongoose = require('mongoose');

mongoose.connect('mongodb://localhost:27017/shop');
var products = [
    new Product({
        imagePath: 'data:image/webp;base64,',
        title: 'Power of Subconscious Mind',
        description: 'by Joseph Murphy',
        price: 15
    }),
    new Product({
        imagePath: 'data:image/webp;base64,',
        title: 'The Subtle Art of Not Giving a F*ck',
        description: 'by Mark Manson',
        price: 20
    }),
    new Product({
        imagePath: 'https://images-na.ssl-images-amazon.com/images/I/51Y8jwGiebL._SX328_BO1,204,203,200_.jpg',
        title: 'Think and Grow Rich ',
        description: 'by Napoleon Hill',
        price: 15
    }),
    new Product({
        imagePath: 'data:image/webp;base64,',
        title: 'Rich Dad Poor Dad',
        description: ' What the Rich Teach their Kids About Money that the Poor and Middle Class Do Not!' +
        'by Robert T Kiyosaki ',
        price: 40
    }),

    new Product({
        imagePath: 'https://images-eu.ssl-images-amazon.com/images/I/51UJKxhocQL.jpg',
        title: 'Sacred Games' ,
        description: 'by Vikram Chandra',
        price: 50
    })
];

var done = 0;
for (var i = 0; i < products.length; i++) {
    products[i].save(function(err, result) {
        done++;
        if (done === products.length) {
            exit();
        }
    });
}

function exit() {
    mongoose.disconnect();
}